results:
  Age:
    code:
    - - .isComplete('Age')
      - Passed
    - - .isNonNegative('Age')
      - Passed
  Billing Amount:
    code:
    - - .isComplete('Billing Amount')
      - Passed
  Gender:
    code:
    - - .isComplete('Gender')
      - Passed
    - - .isContainedIn('Gender', ['Male', 'Female'])
      - Passed
  Medical Condition:
    code:
    - - .isComplete('Medical Condition')
      - Passed
    - - .isContainedIn('Medical Condition', ['Hypertension', 'Cancer', 'Obesity',
        'Arthritis', 'Diabetes', 'Asthma'])
      - Passed
  id:
    code:
    - - .isComplete('id')
      - Passed
    - - .isUnique('id')
      - Passed
